import NextButtonLayout from './NextButtonLayout'
import PrevButtonLayout from './PrevButtonLayout'
import EscButtonLayout from './EscButtonLayout'

const layoutStyle = {
  textAlign:'center'
};

const Layout = props => (
  <div style={layoutStyle}>
    {props.children}
    <EscButtonLayout />
    <PrevButtonLayout />
    <NextButtonLayout />
  </div>
);

export default Layout;
